import React from "react";
import styled from "styled-components";
const MenuItems = (props) => {
  if (props.items.drop1) {
    console.log(props.items.dropdown);
    props.items.dropdown.map((item) => {
      return (
        <div>
          <div>{item.text}</div>
        </div>
      );
    });
  } else if (props.items.drop2) {
    props.items.dropdown.map((item) => {
      console.log(item.text);
    });
  }
  const Container = styled.div``;
  //   return (
